import React from "react";
import Nav from "../components/Nav.js";
import Footer from "../components/Footer.js";
import "../components/style/Home.css";

export default function Home() {
  return (
    <div>
      <Nav />
      <div>
        <section>
          <div className="section-content-1">
            
            <div className="section-content-1-content-1"></div>
          </div>
          <div className="section-content-2"></div>
          <div className="section-content-3"></div>
          <div className="section-content-4"></div>
          <div className="section-content-5"></div>
          <div className="section-content-6"></div>
          <div className="section-content-7"></div>
          <div className="section-content-8"></div>
        </section>
      </div>
      <Footer></Footer>
    </div>
  );
}
